import { useContext } from 'react'
import ControlPanelContext from '../../../../../Context/ControlPanelContext'
import styles from '../ControlPanel.module.scss'

function DemandRateReport() {
    return (
        <div>DemandRateReport</div>
    )
}
function WarehouseReport() {
    return (
        <div>WarehouseReport</div>
    )
}
function FullReport() {
    return (
        <div>FullReport</div>
    )
}
function ABCReport() {
    return (
        <div>ABCReport</div>
    )
}

function MethodReports() {
    const value = useContext(ControlPanelContext)
    if (value.state === 'Скорость спроса')
        return (<DemandRateReport />)
    else if (value.state === 'Склад')
        return (<WarehouseReport />)
    else if (value.state === 'Полный отчет')
        return (<FullReport />)
    else if (value.state === 'ABC Анализ')
        return (<ABCReport />)
    else return (<div>Этот компонент пока не создан</div>)
}

export default function Report() {
    return (
        <div className={styles['controlPanel-']}></div>
    )
}
